import styled from "styled-components";

export const Container = styled.div`
  height: 100vh;
  width: 100vw;
  background: #e8e9ed;
  margin: 0px;
  display: flex;

  .left-content {
    width: 50vw;
    display: flex;
    flex-direction: column;
    justify-content: center;
    padding: 5vw;
  }

  .right-content {
    max-width: 50vw;

    .hero-image {
      width: 50vw;
    }
  }

  .archivo {
    font-family: "Archivo";
  }
`;
